Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.api.java.function.PairFunction
import org.apache.spark.broadcast.Broadcast
import scala.collection.mutable.Map
import java.util.Date
import java.text.SimpleDateFormat

// Define a case class to represent a query and its timestamp
case class Query(query: String, timestamp: Long)

// Define a function to parse a query and its timestamp from a string
def parseQuery(line: String): Query = {
  val fields = line.split(",")
  Query(fields(0), fields(1).toLong)
}

// Define a function to check if a query is in the top frequent queries
def isTopQuery(query: String, topQueries: Broadcast[JavaRDD[String]]): Boolean = {
  topQueries.value.collect().contains(query)
}

// Define a function to calculate the cache hit rate
def calculateHitRate(onsiteData: JavaRDD[Query], topQueries: Broadcast[JavaRDD[String]]): Double = {
  // Create a map to store the cache
  val cache = Map[String, Long]()

  // Create a map to store the cache hits and misses
  val hitMissMap = Map[String, Int]()

  // Process each query in the onsite data
  onsiteData.foreach(query => {
    // Check if the query is in the top frequent queries
    if (isTopQuery(query.query, topQueries)) {
      // Check if the query is in the cache
      if (cache.contains(query.query)) {
        // Check if the query is still in the cache
        if (query.timestamp - cache(query.query) <= 12 * 60 * 60 * 1000) {
          // Increment the cache hit count
          hitMissMap("hits") = hitMissMap.getOrElse("hits", 0) + 1
        } else {
          // Remove the query from the cache
          cache.remove(query.query)
        }
      } else {
        // Increment the cache miss count
        hitMissMap("misses") = hitMissMap.getOrElse("misses", 0) + 1

        // Add the query to the cache
        cache(query.query) = query.timestamp
      }
    }
  })

  // Calculate the hit rate
  val totalQueries = hitMissMap.getOrElse("hits", 0) + hitMissMap.getOrElse("misses", 0)
  val hitRate = if (totalQueries > 0) hitMissMap.getOrElse("hits", 0).toDouble / totalQueries else 0.0

  hitRate
}

// Define the main function
def main(args: Array[String]) {
  // Create a SparkContext
  val spark = new SparkContext(new SparkConf().setAppName("HitRateCalculator"))

  // Load the onsite data
  val onsiteData = spark.textFile("onsite_data.csv").map(parseQuery)

  // Load the top frequent queries
  val topQueries = spark.textFile("top_queries.txt")

  // Broadcast the top frequent queries
  val topQueriesBroadcast = spark.broadcast(topQueries)

  // Calculate the hit rate
  val hitRate = calculateHitRate(onsiteData, topQueriesBroadcast)

  // Print the hit rate
  println(s"Hit rate: $hitRate")

  // Stop the SparkContext
  spark.stop()
}
```
