To create a tooltip in NextJS using React Context to close the previously opened tooltip, you can follow these steps:

1. Create a Tooltip Context:

First, create a context for the tooltip component. This context will be used to manage the state of the tooltip and provide a way to close the previously opened tooltip.

Create a new file called `TooltipContext.js` and add the following code:
```javascript
import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```
2. Create a Tooltip Provider:

Next, create a tooltip provider component that will wrap the tooltip components and provide the context to them. This component will manage the state of the tooltip and provide a way to close the previously opened tooltip.

Create a new file called `TooltipProvider.js` and add the following code:
```javascript
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, closeTooltip, openTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
3. Create a Tooltip Component:

Now, create a tooltip component that will use the context to manage its state and close the previously opened tooltip.

Create a new file called `Tooltip.js` and add the following code:
```javascript
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, closeTooltip, openTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    openTooltip(id);
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {activeTooltip === id && (
        <div className="tooltip">
          {children}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
4. Use the Tooltip Provider and Component:

Finally, use the tooltip provider and component in your NextJS application. Wrap the tooltip components with the tooltip provider and use the tooltip component to display the tooltip.

Here's an example of how to use the tooltip provider and component in a NextJS page:
```javascript
import React from 'react';
import TooltipProvider from './TooltipProvider';
import Tooltip from './Tooltip';

const MyPage = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip id="tooltip1">
          Hover over me
        </Tooltip>
        <Tooltip id="tooltip2">
          Hover over me too
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default MyPage;
```
In this example, the `TooltipProvider` component wraps the `Tooltip` components and provides the context to them. The `Tooltip` component uses the context to manage its state and close the previously opened tooltip.

When the user hovers over a tooltip, the `openTooltip` function is called with the tooltip's ID, and the tooltip is displayed. When the user moves the mouse away from the tooltip, the `closeTooltip` function is called, and the tooltip is closed.

By using React Context, we can manage the state of the tooltip and provide a way to close the previously opened tooltip, even if the tooltip components are used in different places and are isolated from each other.

