Creating a Chrome extension involves several steps and requires knowledge of HTML, CSS, and JavaScript. Here's a basic outline of how you can create a Chrome extension that takes screenshots of a webpage:

1. Create a new folder for your extension and create the following files inside it:

- `manifest.json`: This file contains metadata about your extension, such as its name, version, and permissions.

- `popup.html`: This file contains the HTML for the popup window that will appear when the user clicks on the extension's icon.

- `popup.js`: This file contains the JavaScript code that will be executed when the popup window is opened.

2. Add the following code to `manifest.json`:
```json
{
  "manifest_version": 2,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "description": "Take screenshots of webpages",
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "permissions": [
    "activeTab",
    "tabs",
    "<all_urls>"
  ]
}
```
This code sets the name, version, and description of your extension, as well as specifying the icon and popup window. It also requests the necessary permissions to access the active tab and all URLs.

3. Add the following code to `popup.html`:
```html
<!DOCTYPE html>
<html>
  <head>
    <style>
      body {
        width: 300px;
        height: 200px;
      }
      button {
        width: 100%;
        height: 50px;
        font-size: 20px;
      }
    </style>
  </head>
  <body>
    <button id="screenshot">Take Screenshot</button>
    <script src="popup.js"></script>
  </body>
</html>
```
This code creates a simple popup window with a single button that will trigger the screenshot functionality.

4. Add the following code to `popup.js`:
```javascript
document.getElementById("screenshot").addEventListener("click", function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.captureVisibleTab(null, {}, function(img) {
      var screenshotUrl = img;
      var viewTabUrl = tabs[0].url;
      chrome.tabs.create({url: screenshotUrl, active: true});
    });
  });
});
```
This code adds an event listener to the "Take Screenshot" button that captures the visible area of the active tab and opens a new tab displaying the screenshot.

5. Load your extension into Chrome:

- Open Chrome and navigate to `chrome://extensions`.
- Enable "Developer mode" by clicking the toggle switch in the top right corner.
- Click the "Load unpacked" button and select the folder containing your extension.

Your extension should now be loaded and ready to use. To take a screenshot of a webpage, simply click on the extension's icon in the Chrome toolbar and click the "Take Screenshot" button.

