Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
Static variables are variables that retain their value between function calls. They are declared using the keyword "static" and are initialized only once. They have a default value of zero if not explicitly initialized. Static variables are stored in the data segment of the program's memory.

Here is an example of a static variable:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
```
In this example, the variable "count" is declared as static inside the function "increment". Each time the function is called, the value of "count" is incremented and printed. Since "count" is static, its value is retained between function calls.

2. Register Variables:
Register variables are variables that are stored in the CPU register instead of RAM. This makes them faster to access than regular variables. However, the number of CPU registers is limited, so only a few variables can be declared as register. Register variables are declared using the keyword "register".

Here is an example of a register variable:
```c
#include <stdio.h>

void increment() {
    register int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}

