Here are the JavaScript functions to pack and unpack an array of entities to an ArrayBuffer:

```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length * 1);
  const view = new DataView(buffer);

  entities.forEach((entity, index) => {
    const byte = (entity.id << 3) | (entity.size & 0x07);
    view.setUint8(index, byte);
  });

  return buffer;
}

function unpackEntities(buffer) {
  const view = new DataView(buffer);
  const entities = [];

  for (let i = 0; i < view.byteLength; i++) {
    const byte = view.getUint8(i);
    const id = (byte >> 3) & 0x0F;
    const size = byte & 0x07;
    entities.push({ id, size });
  }

  return entities;
}
```

These functions assume that the `entities` array contains objects with `id` and `size` properties. The `packEntities` function creates an ArrayBuffer with a size of `entities.length * 1` bytes, as each entity is packed into a single byte. It then iterates through the entities, packing each one into a byte using bitwise operations.

The `unpackEntities` function does the reverse, iterating through the ArrayBuffer and unpacking each byte into an entity object using bitwise operations. It returns an array of these entity objects.

